import React from 'react';
import { View, Button, Text, StyleSheet } from 'react-native';
import ProfileInfoViewModel from './ViewModel';
import { StackScreenProps } from '@react-navigation/stack';
import { RootSatckParamList } from '../../../../../App';

interface Props extends StackScreenProps<RootSatckParamList, 'ProfileInfoScreen'>{};

const ProfileInfoScreen = ({navigation, route}:Props) => {
    const {removeSession } = ProfileInfoViewModel();

    // Simulando datos del usuario. Remplaza esto con tus datos reales.
    // Por ejemplo, podrías estar pasando estos datos a través de `route.params`
    // o cargándolos desde un contexto/global state.
    const userData = {
        name: "Juan Pérez",
        email: "juan.perez@example.com",
        // Añade más campos según necesites
    };

    return (
        <View style={styles.container}>
            {/* Vista del perfil del usuario */}
            <View style={styles.profileSection}>
                <Text style={styles.profileText}>Nombre: {userData.name}</Text>
                <Text style={styles.profileText}>Email: {userData.email}</Text>
                {/* Añade más campos del perfil aquí */}
            </View>

            {/* Botón de cerrar sesión */}
            <Button 
                onPress={() => {
                    removeSession();
                    navigation.navigate('LoginScreen');
                }}
                title='Cerrar Sesión'
            />
        </View>
    );
}

// Estilos para el componente
const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    profileSection: {
        marginBottom: 20,
        // Puedes personalizar estos estilos
    },
    profileText: {
        fontSize: 16,
        // Puedes personalizar estos estilos
    },
});

export default ProfileInfoScreen;
